void MatrixpairM8(M8 *Mat,M8 *Mat_inv)
{
    M8 Temp,Temp_inv;
    int flag[10]={0};
    identityM8(&Temp);
    identityM8(&Temp_inv);
    srand((randseed++)^time(NULL));
    int randnum=rand()%1024;
    for(int i=0;i<10;i++)
    {
        if(randnum&0x1) 
        {
            MatMulMatM8(Temp,MatrixM8[i],&Temp);
            flag[i]=1;
        }
        randnum=randnum>>1;
    }
    for(int i=9;i>=0;i--)
    {
        if(flag[i]) MatMulMatM8(Temp_inv,MatrixM8_inv[i],&Temp_inv);
    }
    copyM8(Temp,Mat);
    copyM8(Temp_inv,Mat_inv);
}
